import React from "react";
import PropTypes from "prop-types";
import Layout from "components/Layout/Layout";

const Index = ({ t }) => {
	props = {
		namespacesRequired: ["common"]
	};

	return <Layout>Index page created.</Layout>;
};

export default Index;
